var script_f39_35_40496=[" ",
"",
"var calctxt = '';",
"var xmltxt = '';",
"var htmtxt = '';",
"",
"",
"function PulmonaryEmbRisk_fx() {",
"with(document.PulmonaryEmbRisk_form){",
"",
"Score = 0.0;",
"doCalc = true;",
"",
"if (cc1.checked){",
"Score = Score + 3;",
"}",
"if (cc2.checked){",
"Score = Score + 3;",
"}",
"if (cc3.checked){",
"Score = Score + 1.5;",
"}",
"if (cc4.checked){",
"Score = Score + 1.5;",
"}",
"if (cc5.checked){",
"Score = Score + 1.5;",
"}",
"if (cc6.checked){",
"Score = Score + 1;",
"}",
"if (cc7.checked){",
"Score = Score + 1;",
"}",
"cctotal.value = Score;",
"",
"if (doCalc){",
"rrclr();",
"if (Score >6){ document.getElementById('rr1_1').bgColor = '#cccccc';",
"}",
"if ((Score >=2) && (Score <=6)){ document.getElementById('rr1_2').bgColor = '#cccccc';",
"}",
"if (Score <2){ document.getElementById('rr1_3').bgColor = '#cccccc';",
"}",
"",
"}",
"}",
"}",
"",
"",
"",
"",
"function rrclr(){",
"document.getElementById('rr1_1').bgColor = \"\";",
"document.getElementById('rr1_2').bgColor = \"\";",
"document.getElementById('rr1_3').bgColor = \"\";",
"}",
"",
"",
""].join("\n");
