"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?39/35/40505/abstract/1\">",
"      M&uuml;llner M, Urbanek B, Havel C, et al. Vasopressors for shock. Cochrane Database Syst Rev 2004; :CD003709.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?39/35/40505/abstract/2\">",
"      AHLQUIST RP. A study of the adrenotropic receptors. Am J Physiol 1948; 153:586.",
"     </a>",
