var title_f39_35_40507="Sex reassignment surgery eligibility and readiness criteria";
var content_f39_35_40507=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F60865&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F60865&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sex reassignment surgery eligibility and readiness criteria",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Individuals treated with cross-sex hormones are considered eligible for sex reassignment surgery if they:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Are of the legal age of majority in their nation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Have used cross-sex hormones continuously and responsibly during 12 months (if they have no medical contraindication).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3. Had a successful continuous full-time real life experience (RLE) during 12 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4. Have (if required by the mental health professional [MHP]) regularly participated in psychotherapy throughout the RLE at a frequency determined jointly by the patient and the MHP.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5. Have shown demonstrable knowledge of all practical aspects of surgery (eg, cost, required lengths of hospitalizations, likely complications, postsurgical rehabilitation, etc).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Individuals treated with cross-sex hormones should fulfill the following readiness criteria prior to sex reassignment surgery:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. Demonstrable progress in consolidating one's gender identity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Demonstrable progress in dealing with work, family, and interpersonal issues, resulting in a significantly better state of mental health.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Hembree WC, Cohen-Kettenis P, Delemarre-van de Waal HA, et al. Endocrine treatment of transsexual persons: an Endocrine Society clinical practice guideline. J Clin Endocrinol Metab 2009; 94:3132. Copyright &copy; 2009 The Endocrine Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
