var title_f39_35_40508="Anticoagulation regimens in pregnancy";
var content_f39_35_40508=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F56377&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F56377&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Anticoagulation regimen definitions",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Management type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dosage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Prophylactic LMWH*",
"       </td>",
"       <td>",
"        Enoxaparin, 40 mg SC once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dalteparin, 5000 units SC once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tinzaparin, 4500 units SC once daily",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        <p>",
"         Therapeutic LMWH",
"         <sup>",
"          &bull;",
"         </sup>",
"        </p>",
"        <p>",
"         (Also referred to as weight-adjusted, full-treatment dose)",
"        </p>",
"       </td>",
"       <td>",
"        Enoxaparin, 1 mg/kg every 12 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dalteparin, 200 units/kg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tinzaparin, 175 units/kg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dalteparin, 100 units/kg every 12 hours",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Minidose prophylactic UFH",
"       </td>",
"       <td>",
"        UFH, 5000 units SC every 12 hours",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Prophylactic UFH",
"       </td>",
"       <td>",
"        UFH, 5000-10,000 units SC every 12 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        UFH, 5000-7500 units SC every 12 hours in first trimester",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        UFH, 7500-10,000 units SC every 12 hours in the second trimester",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        UFH, 10,000 units SC every 12 hours in the third trimester, unless the aPTT is elevated",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <p>",
"         Therapeutic UFH",
"        </p>",
"        <p>",
"         (Also referred to as weight-adjusted, full-treatment dose)",
"        </p>",
"       </td>",
"       <td>",
"        UFH, 10,000 units or more SC every 12 hours in doses adjusted to target aPTT in the therapeutic range (1.5-2.5, 6 hours after injection)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Postpartum anticoagulation",
"       </td>",
"       <td>",
"        Prophylactic LMWH/UFH for 4-6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin K antagonists for 4-6 weeks with a target INR of 2.0-3.0, with initial UFH or LMWH therapy overlap until the INR is 2.0 or more for 2 days",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Surveillance",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LMWH: low molecular weight heparin; SC: subcutaneously; UFH: unfractionated heparin; aPTT: activated partial thromboplastin time; INR: international normalized ratio.",
"     <br>",
"      * Although at extremes of body weight, modification of dose may be required.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       May target an anti-Xa level in the therapeutic range of 0.6-1.0 units/mL for twice daily regimen; slightly higher doses may be needed for a once-daily regimen.",
"       <br>",
"        &Delta; Clinical vigilance and appropriate objective investigation of women with symptoms suspicious of deep vein thrombosis or pulmonary embolism may be needed.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: ACOG Practice Bulletin #123. Thromboembolism in pregnancy. Obstet Gynecol 2011; 118:718. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
